import "./style.css";
import React, {Component, useState} from "react";

const App = () => {
  const [name,setName]=useState("");
  const [email,setEmail]=useState("");
  const [gender,setGender]=useState("");
  const [phone,setPhone]=useState("");
  const [password,setPassword]=useState("");
  const [list,setList]=useState([]);
const signForm = ()=>{
   
   const newlist={name,email,gender,phone,password};
   setList([...list,newlist]);
   console.log(list);
}

  return (
    <div id="main">
      <h1> SignUp Form</h1>
       <form action="" onSubmit={signForm}>
         <lable htmlFor="name" >Name</lable>
         <input data-testid="name" type="name" value={name} onChange={(e)=>setName(e.target.value)} /> <br/><br/>
         <lable htmlFor="email">Email</lable>
         <input data-testid ="email" type="email" value={email} onChange={(e)=>setEmail(e.target.value)}  /> <br/><br/>
         <select data-testid = 'gender' >
            <option >Select the Gender</option>
            <option data-testid = 'male' value={gender} onSelect={(e)=>setGender(e.target.value)} >Male</option>
            <option data-testid = 'female' value={gender} onSelect={(e)=>setGender(e.target.value)} >Female</option>
            <option data-testid = 'others' value={gender} onSelect={(e)=>setGender(e.target.value)} >Others</option>
         </select><br/><br/>
         <lable htmlFor="phoneNumber">Phone Number</lable>
         <input data-testid = 'phoneNumber' type="number" value={phone} onChange={(e)=>setPhone(e.target.value)}  /> <br/><br/>
         <lable htmlFor="password">Password</lable>
         <input data-testid ='password' type='password' value={password} onChange={(e)=>setPassword(e.target.value)} /> <br/><br/>
      </form>
      <button data-testid="submit" type="submit">Submit</button>
    </div>
  )
}

export default App;
